import 'dart:typed_data';
import 'package:shared_preferences/shared_preferences.dart';
import 'package:task_manager/models/task_list_model.dart';

import '../api/api_client.dart';

String defaultProfilePic =
    "data:image/png;base64,";

Future<void> writeUserData(Map userData) async {
  SharedPreferences sharedPreferences = await SharedPreferences.getInstance();
  sharedPreferences.setString('token', userData['token']);
  for (var item in userData['data']) {
    sharedPreferences.setString('email', item['email']);
    sharedPreferences.setString('firstName', item['firstName']);
    sharedPreferences.setString('lastName', item['lastName']);
    sharedPreferences.setString('mobile', item['mobile']);
    sharedPreferences.setString('password', item['password']);
  }
}

Future<String?> readUserData(String key) async {
  SharedPreferences sharedPreferences = await SharedPreferences.getInstance();
  String? getData = sharedPreferences.getString(key);
  return getData;
}

Future<bool> logout() async {
  SharedPreferences sharedPreferences = await SharedPreferences.getInstance();
  return sharedPreferences.clear();
}

showBase64Image(String base64) {
  UriData? data = Uri.parse(base64).data;
  Uint8List image = data!.contentAsBytes();
  return image;
}

Future<Map<String, String>> getAppBarData() async {
  String? email = await readUserData('email');
  String? firstName = await readUserData('firstName');
  String? lastName = await readUserData('lastName');
  String? mobile = await readUserData('mobile');
  String? password = await readUserData('password');

  Map<String, String> appBarData = {
    "email": '$email',
    "firstName": '$firstName',
    "lastName": '$lastName',
    "mobile": '$mobile',
    "password": '$password'
  };

  return appBarData;
}
